                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto5": "5.Si se utiliza como criterio dinámico %%TEXTO%% para los campos alfanuméricos.Recuerde que puede usar los comodines % y _ tanto en la consulta como en los criterios dinámicos con el operador COMO. Si queremos hacer una búsqueda aproximada por nombre de colegiado ya que se desconoce su nombre exacto utilizaremos el comodín %NOMBRE COLEGIADO% y la consulta nos devolverá los resultados de esa cadena por ejemplo %JOSE% nos devolverá Maria Jose, Jose Maria.",
                    "administracion.parametrosGenerales.alert.restaurarValor": "Si desmarca el check se restaurará el valor original. ¿Desea continuar?",
                    "busquedaSanciones.periodoEjecucionHasta.literal": "Período Ejecución Hasta",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto6": "6.Para que los criterios dinámicos del campo de texto sean independientes de mayúsculas y minúsculas puede utilizar la función UPPER delante de los campos usados en la consulta. Ejemplo: Si queremos buscar dinámicamente por el nombre de un colegiado para que nos ignore las mayúsculas y minúsculas haremos UPPER(Cen_persona.Nombre)%%OPERADOR%%UPPER(%%TEXTO%%).",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto7": "7.Los campos de salida correspondientes a descripciones 'multi-idioma' deben tener el siguiente formato: F_SIGA_GETRECURSO(campo , %%IDIOMA%%) as 'alias_campo'",
