                    "general.configp": "Configurar Perfil",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto16": "16. S'ha afegit la clàusula DEFECTE per als operadors. La notació serà %%OPERADOR%% %%CRITERIO%% DEFECTO 'VALOR'. Aquests valors apareixeran per defecte a la pantalla de criteris dinàmics. Si el criteri és DATA, el format serà dd/mm/yyyy i també accepta SYSDATE per a la data actual.",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto17": "17. S'ha afegit la clàusula NUL per als operadors. La notació serà %%OPERADOR%% %%CRITERIO%% NULO 'VALOR'. On valor és 'SI' i 'NO'. En cas que no hi hagi serà 'NO'. En el cas que hi hagi la clàusula DEFECTO, ha d'anar sempre darrere d'ella. En cas que admeti nuls, no serà obligatori donar cap valor al criteri dinàmic a la pantalla de criteris dinàmics, i filtrarà com IS NULL",
                    "censo.datosBancarios.mensaje.control.bicIncorrecto": "BIC incorrecte",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto18": "18. Si la consulta pertany a una classe de comunicació serà obligatori introduir en l'etiqueta <WHERE> de la consulta les claus associades a aquesta classe de comunicació. Informes genèrics de cens: %%IDPERSONA%%, %%IDINSTITUCION%%. Informes de sancions de lletrats: %%IDPERSONA%%, %%IDINSTITUCION%%, %%IDSANCION%%. Plantilla d'Ordre de domiciliació de càrrec directe SEPA: %%IDPERSONA%%, %%IDINSTITUCION%%, %%IDCUENTA%%, %%IDMANDATO%%. Plantilla de Annex a l'Ordre de domiciliació de càrrec directe SEPA: %%IDPERSONA%%, %%IDINSTITUCION%%, %%IDCUENTA%%, %%IDMANDATO%%, %%IDANEXO%%. ",
                    "administracion.parametro.pki_sign": "Utilitzat per la capa bàsica del Sistema. No configurable",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto19": "19. És obligatori introduir en l'etiqueta <WHERE> la clau %%IDINSTITUCION%%.",
                    "calendario.literal.mes.octubre": "Octubre",
                    "censo.alterMutua.literal.situacionEjercicio": "Situació exercici",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto12": "12. En el cas de què les consultes siguin d'Enviaments a Grups, la condició del tipus de direcció s'afegeix automàticament i, quan s'executa la consulta, es demana el tipus d'enviament.",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto13": "13. Les consultes de tipus 'Facturació' o 'Enviaments a Grups' tenen les següents restriccions: No es poden incorporar sol·licituds de criteris dinàmics per interfície. Per a les consultes de tipus 'Facturació' els següents camps són obligatoris: IDINSTITUCION, IDPERSONA. Per a les consultes de tipus 'Enviament a Grups': IDINSTITUCION, IDPERSONA, CODIGOPOSTAL, CORREOELECTRONICO, DOMICILIO, MOVIL, FAX1, FAX2, IDPAIS, IDPROVINCIA, IDPOBLACION.",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto14": "14. Les consultes de tipus 'Trameses a Grups' tenen les següents restriccions: les consultes llistes per a enviaments han de portar la taula CEN_CLIENTE i CEN_DIRECCIONES sense àlies. NO s'han d'afegir condicions per filtrar la direcció, ja que això es fa automàticament.",
                    "administracion.parametro.envio_sms_habilitado": "Habilitat (S), en cas contrari (N). Previament confirmar amb Operacions si existeix contracte d'aquest servei.",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto15": "15. S'han afegit els nous operadors =, !=, IS NULL, LIKE al format dels criteris TEXT. A aquests operadors s'afegeixen >, >=, <, <= quan el format sigui NUMERO, DATA o MULTIVALOR. Aquests operadors funcionen de la mateixa manera que %%OPERADOR%%.",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto10": "10. Quan s'utilitza %%FECHA%% com a criteri dinàmic, es pot utilitzar la funció TRUNC quan es vulgui fer les comparacions sense hores/min/seg.",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto11": "11. Es pot fer servir la funció F_SIGA_GETDIRECCION (IDINSTITUCION, IDPERSONA, TIPOENVIO) per a obtenir l'adreça on es faran els enviaments. Aquesta adreça serà sempre la preferent per tipus d'enviament; si no hi ha cap configurada, retornarà la de tipus correu, si no la de despatx i si no qualsevol direcció donada d'alta. TIPOENVIO pot prendre els següents valors: 1, si el tipus d'enviament és per correu electrònic. 2, si el tipus d'enviament és per correu ordinari. 3, si el tipus d'enviament és per fax.",
                    "informesycomunicaciones.consultas.noEliminaConsulta": "No es pot eliminar la consulta",
