                    "justiciaGratuita.maestros.fundamentosCalificacion.datosGenerales.dictamen": "Dictamen#EU",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto20": "20. Si el objetivo de la consulta es 'DESTINATARIOS' se debe añadir dentro de la etiqueta <SELECT> los siguientes campos: IDINSTITUCION, IDPERSONA, IDIOMA, CODIGOPOSTAL, CORREOELECTRONICO, DOMICILIO, MOVIL, FAX1, FAX2, IDPAIS, IDPROVINCIA, IDPOBLACION#EU",
