                    "oficio.busquedaInscripcion.cambioFecha.validacionErrorColegiado": "Uno de los registros seleccionados tiene una guardia con una fecha de validacion anterior o igual a la fecha cumplimentada.#EU",
                    "administracion.parametro.imprimir_etiquetas_envio": "Utilizado por APIs de generación automática de envíos. No configurable.#EU",
                    "enviosMasivos.literal.titulos": "Envíos masivos#EU",
                    "facturacionSJCS.baremosDeGuardia.porDia": "Por Día#EU",
                    "menu.justiciaGratuita.remesas.informacionEconomica": "Remesas información económica#EU",
                    "general.configp": "Configurar Perfil#EU",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto16": "16.Se ha añadido la cláusula DEFECTO para los operadores. La notación será %%OPERADOR%% %%CRITERIO%% DEFECTO 'VALOR'. Estos valores aparecerán por defecto en la pantalla de criterios dinámicos. Si el criterio es FECHA el formato será dd/mm/yyyy y también acepta SYSDATE para la fecha actual.#EU",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto17": "17.Se ha añadido la cláusula NULO para los operadores. La notación será %%OPERADOR%% %%CRITERIO%% NULO 'VALOR'. Donde valor es 'SI' y 'NO'. En caso que no exista será 'NO'. En el caso de que exista la cláusula DEFECTO debe ir siempre detrás de ella. En caso de que admita nulos no será obligatorio dar ningún valor al criterio dinámico en la pantalla de criterios dinámicos y filtrará como IS NULL#EU",
                    "censo.datosBancarios.mensaje.control.bicIncorrecto": "BIC incorrecto#EU",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto18": "18.Si la consulta pertenece a una clase de comunicación será obligatorio introducir en la etiqueta <WHERE> de la consulta las claves asociadas a dicha clase de comunicación. Informes genéricos de censo: %%IDPERSONA%%, %%IDINSTITUCION%%. Informes de sanciones de letrados: %%IDPERSONA%%, %%IDINSTITUCION%%, %%IDSANCION%%. Plantilla de Orden de domiciliación de adeudo directo SEPA: %%IDPERSONA%%, %%IDINSTITUCION%%, %%IDCUENTA%%, %%IDMANDATO%%. Plantilla de Anexo a la Orden de domiciliación de adeudo directo SEPA: %%IDPERSONA%%, %%IDINSTITUCION%%, %%IDCUENTA%%, %%IDMANDATO%%, %%IDANEXO%%. #EU",
                    "administracion.parametro.pki_sign": "Utilizado por la capa básica del Sistema. No configurable#EU",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto19": "19. Es obligatorio introducir en la etiqueta <WHERE> la clave %%IDINSTITUCION%%.#EU",
                    "calendario.literal.mes.octubre": "urriaren",
                    "censo.alterMutua.literal.situacionEjercicio": "Situación ejercicio#EU",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto12": "12.En el caso en que las consultas sean de Envíos a Grupos, la condición del tipo de dirección se añade automáticamente y cuando se ejecuta la consulta se pide el tipo de envío.#EU",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto13": "13.Las consultas de tipo 'Facturación' o 'Envío a Grupos' tienen las siguientes restricciones: No puede incorporar solicitudes de criterios dinámicos por interfaz. Para las consultas de tipo 'Facturación' los siguientes campos son obligatorios: IDINSTITUCION , IDPERSONA. Para las consultas de tipo 'Envío a Grupos': IDINSTITUCION, IDPERSONA, CODIGOPOSTAL, CORREOELECTRONICO, DOMICILIO, MOVIL, FAX1, FAX2, IDPAIS, IDPROVINCIA, IDPOBLACION.#EU",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto14": "14.Las consultas de tipo 'Envío a Grupos' tiene las siguientes restricciones: Las consultas listas para envíos han de llevar la tabla CEN_CLIENTE y CEN_DIRECCIONES sin alias. NO se debe añadir condiciones para filtrar la dirección, ya que eso se hace automáticamente.#EU",
                    "administracion.parametro.envio_sms_habilitado": "Habilitado (S), en caso contrario(N). Previamente confirmar con operaciones si existe contrato de este servicio.#EU",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto15": "15.Se han añadido los nuevos operadores =,!=,IS NULL,LIKE al formato de los criterios TEXTO. A estos operadores se añaden >,>=,<,<= cuando el formato sea NUMERO, FECHA o MULTIVALOR. Estos operadores funcionan del mismo modo que %%OPERADOR%%.#EU",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto10": "10.Cuando se utiliza %%FECHA%% como criterio dinámicos, se puede utilizar la función TRUNC cuando se desee hacer las comparaciones sin horas/min/seg.#EU",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto11": "11.Puede utilizar la función F_SIGA_GETDIRECCION (IDINSTITUCION, IDPERSONA, TIPOENVIO) para obtener una dirección a donde se harán los envíos. Esta dirección será siempre la preferente por tipo de envío, si no hay ninguna configurada, devolverá la de tipo correo, si no la de despacho y si no cualquier dirección dada de alta. TIPOENVIO puede tomar los siguientes valores: 1, si el tipo de envío es por correo electrónico. 2, si el tipo de envío es por correo ordinario. 3, si el tipo de envío es por fax.#EU",
                    "informesycomunicaciones.consultas.noEliminaConsulta": "No puede eliminarse la consulta#EU",
