                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto4": "4.Los formatos de criterios dinámicos admitidos son: %%NUMERO%%, para campos numéricos.%%TEXTO%%, para campos alfanuméricos. %%FECHA%%, para fechas. %%MULTIVALOR@CONSULTA%%, para campos multivalor. CONSULTA es una consulta con campos de salida ID y DESCRIPCION que no debe ir encerrada entre paréntesis.#EU",
