                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto3": "3.Los criterios dinámicos deben ir delimitados por los delimitadores %%OPERADOR%% %%CRITERIO%%, CRITERIO es el formato del campo.#GL",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto4": "4.Los formatos de criterios dinámicos admitidos son: %%NUMERO%%, para campos numéricos.%%TEXTO%%, para campos alfanuméricos. %%FECHA%%, para fechas. %%MULTIVALOR@CONSULTA%%, para campos multivalor. CONSULTA es una consulta con campos de salida ID y DESCRIPCION que no debe ir encerrada entre paréntesis.#GL",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto5": "5.Si se utiliza como criterio dinámico %%TEXTO%% para los campos alfanuméricos.Recuerde que puede usar los comodines % y _ tanto en la consulta como en los criterios dinámicos con el operador COMO. Si queremos hacer una búsqueda aproximada por nombre de colegiado ya que se desconoce su nombre exacto utilizaremos el comodín %NOMBRE COLEGIADO% y la consulta nos devolverá los resultados de esa cadena por ejemplo %JOSE% nos devolverá Maria Jose, Jose Maria.#GL",
                    "administracion.parametrosGenerales.alert.restaurarValor": "Si desmarca el check se restaurará el valor original. ¿Desea continuar?#GL",
                    "busquedaSanciones.periodoEjecucionHasta.literal": "Período Ejecución Hasta#GL",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto6": "6.Para que los criterios dinámicos del campo de texto sean independientes de mayúsculas y minúsculas puede utilizar la función UPPER delante de los campos usados en la consulta. Ejemplo: Si queremos buscar dinámicamente por el nombre de un colegiado para que nos ignore las mayúsculas y minúsculas haremos UPPER(Cen_persona.Nombre)%%OPERADOR%%UPPER(%%TEXTO%%).#GL",
                    "informesYcomunicaciones.consultas.mensaje.ayuda.texto7": "7.Los campos de salida correspondientes a descripciones 'multi-idioma' deben tener el siguiente formato: F_SIGA_GETRECURSO(campo , %%IDIOMA%%) as 'alias_campo'#GL",
